import React from "react";
import bgVideo from "../Images/rain.mp4";
import "./css/videoBg.css";

function VideoBgSection() {
  return (
    <div>
      <video src={bgVideo} autoPlay muted loop>
        <div className="text-on-video">
          <h2>HELLOOOO</h2>
        </div>
      </video>
    </div>
  );
}

export default VideoBgSection;
